import React, { useState } from "react";
import AfroWigs from "../pages/products/AfroWigs";
import BraidedWigs from "./products/BraidedWigs";
import HumanWigs from "./products/HumanWigs";
import SyntheticWig from "./products/SyntheticWig";
import WigAccessories from "./products/WigAccessories";

export default function ProductContent() {
  const [select, setSelect] = useState("AfroWigs");
  return (
    <div>
      {select === "AfroWigs" && <AfroWigs />}
      {select === "BraidedWigs" && <BraidedWigs />}
      {select === "HumanWigs" && <HumanWigs />}
      {select === "SyntheticWig" && <SyntheticWig />}
      {select === "WigAccessories" && <WigAccessories />}
    </div>
  );
}
